/**
 * @param {object[]} children
 * @param {function} callback
 * @return {string}
 */
export function serialize(children: any[], callback: Function): string;
/**
 * @param {object} element
 * @param {number} index
 * @param {object[]} children
 * @param {function} callback
 * @return {string}
 */
export function stringify(element: any, index: number, children: any[], callback: Function): string;
